import { Header, Body } from './components';
import { useState } from 'react';

function App() {

  var [logStatus, logStatusSetter] = useState();

  return (
    <div className="bg-[#012946] h-fit">
      <Header loggo={logStatus} loggoSetter={logStatusSetter}/>
      <Body loggo={logStatus} loggoSetter={logStatusSetter}/>
      <footer className="text-[12px] text-center w-full bottom-8 absolute">
        Using lukePeavy's quotable API.
      </footer>
    </div>
  );
}

export default App;
